// Utility functions for data manipulation
function getCastleDataPage(page = 0, pageSize = 20) {
    const startIndex = page * pageSize;
    const endIndex = startIndex + pageSize;
    return {
        data: filteredData.slice(startIndex, endIndex), // Використовуємо filteredData
        hasMore: endIndex < filteredData.length,
        totalRecords: filteredData.length,
        currentPage: page,
        totalPages: Math.ceil(filteredData.length / pageSize)
    };
}

function searchCastleData(searchTerm) {
    if (!searchTerm) return CASTLE_DATA_FULL;
    const term = searchTerm.toLowerCase();
    return CASTLE_DATA_FULL.filter(row => 
        row.some(cell => cell.toString().toLowerCase().includes(term))
    );
}

function filterByCastle(castleName) {
    if (!castleName) return CASTLE_DATA_FULL;
    return CASTLE_DATA_FULL.filter(row => row[0] === castleName);
}

function filterByReward(rewardName) {
    if (!rewardName) return CASTLE_DATA_FULL;
    return CASTLE_DATA_FULL.filter(row => row[1] === rewardName);
}

function filterByFruit(fruitName) {
    if (!fruitName) return CASTLE_DATA_FULL;
    return CASTLE_DATA_FULL.filter(row => row[3] === fruitName);
}

// Export for browser environment
if (typeof window !== 'undefined') {
    window.CASTLE_DATA_FULL = CASTLE_DATA_FULL;
    window.getCastleDataPage = getCastleDataPage;
    window.searchCastleData = searchCastleData;
    window.filterByCastle = filterByCastle;
    window.filterByReward = filterByReward;
    window.filterByFruit = filterByFruit;
}

// Export for Node.js environment
if (typeof module !== 'undefined' && module.exports) {
    module.exports = {
        CASTLE_DATA_FULL,
        getCastleDataPage,
        searchCastleData,
        filterByCastle,
        filterByReward,
        filterByFruit
    };
}

